pragma solidity ^0.4.23;

import "openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";
import "openzeppelin-solidity/contracts/lifecycle/Pausable.sol";

contract TokenGateway is Ownable, Pausable {
    /**
    * @dev Details of each transfer
    * @param contract_ contract address of ER20 token to transfer
    * @param to_ receiving account
    * @param amount_ number of tokens to transfer to_ account
    * @param failed_ if transfer was successful or not
    */
    struct Transfer {
        address contract_;
        address to_;
        uint amount_;
        bool failed_;
    }
    /**
    * @dev Wallet details of echo user
    * @param totalBalance total balance of ER20 token
    * @param freezedBalance receiving account
    * @param isDisabled is that user being disabled
    * @param isOnTransaction is on trnascation, not allow to withdraw
    */

    struct User {
        mapping(bytes32 => uint256) totalBalance;
        mapping(bytes32 => uint256) freezedBalance;
        bool isDisabled;
        bool isLocked;
    }

    mapping(address => User) private userBalances_;
    /**
    * @dev a mapping from transaction ID's to the sender address
    * that initiates them. Owners can create several transactions
    */
    mapping(address => uint[]) public transactionIndexesToSender;
    /**
    * @dev a list of all transfers successful or unsuccessful
    */
    Transfer[] public transactions;

    address public owner;

    /**
    * @dev list of all supported tokens for transfer
    * @param string token symbol
    * @param address contract address of token
    */
    mapping(bytes32 => address) public tokens;

    ERC20 public ERC20Interface;
    /**
    * @dev Event to notify if transfer successful or failed
    * after account approval verified
    */
    event TransferSuccessful(address indexed from_, address indexed to_, uint256 amount_);

    event TransferFailed(address indexed from_, address indexed to_, uint256 amount_);


    /**
    * @dev add address of token to list of supported tokens using
    * token symbol as identifier in mapping
    */
    function addNewToken(bytes32 symbol_, address address_) public onlyOwner returns (bool) {
        tokens[symbol_] = address_;

        return true;
    }

    /**
    * @dev remove address of token we no more support
    */
    function removeToken(bytes32 symbol_) public onlyOwner   returns (bool) {
        require(tokens[symbol_] != 0x0);

        delete (tokens[symbol_]);

        return true;
    }

    function balanceOf(address user_, bytes32 symbol_) public view returns (uint256) {
        return userBalances_[user_].totalBalance[symbol_];

    }

    function balanceOfFreezed(address user_, bytes32 symbol_) public view returns (uint256) {
        return userBalances_[user_].freezedBalance[symbol_];

    }

    function balanceOfAvailable(address user_, bytes32 symbol_) public view returns (uint256) {
        return balanceOf(user_, symbol_) - balanceOfFreezed(user_, symbol_);

    }
    function setUserLock(address user_, bool lock) private{
        userBalances_[user_].isLocked = lock;
    }

    function getUserLock(address user_) private view returns (bool) {
        return userBalances_[user_].isLocked;
    }

    function freezeToken(address user_, bytes32 symbol_, uint256 amount_)  onlyOwner public {
        require( balanceOfAvailable(user_, symbol_) >= amount_);
        userBalances_[user_].freezedBalance[symbol_] += amount_;


    }

    function unfreezeToken(address user_, bytes32 symbol_, uint256 amount_) onlyOwner public {
        require(balanceOfFreezed(user_, symbol_) <= amount_);
        userBalances_[user_].freezedBalance[symbol_] -= amount_;

    }

    function deposit(bytes32 symbol_, uint256 amount_) public whenNotPaused {
        require(tokens[symbol_] != 0x0, "invalid symbol");
        require(amount_ > 0 ,"amount must greater than 0");

        address contract_ = tokens[symbol_];
        address from_ = msg.sender;
        address to_ = address(this);
        ERC20Interface = ERC20(contract_);

        uint256 transactionId = transactions.push(
            Transfer({
            contract_ : contract_,
            to_ : to_,
            amount_ : amount_,
            failed_ : true
            })
        );
        transactionIndexesToSender[from_].push(transactionId - 1);

        if (amount_ > ERC20Interface.allowance(from_, address(this))) {
            emit TransferFailed(from_, to_, amount_);
            revert();
        }
        ERC20Interface.transferFrom(from_, to_, amount_);

        transactions[transactionId - 1].failed_ = false;

        userBalances_[from_].totalBalance[symbol_] += amount_;
        emit TransferSuccessful(from_, to_, amount_);
    }
    /**
    * @dev method that handles transfer of ERC20 tokens to other address
    * it assumes the calling address has approved this contract
    * as spender
    * @param symbol_ identifier mapping to a token contract address
    * @param to_ beneficiary address
    * @param amount_ numbers of token to transfer
    */
    function transferTokens(bytes32 symbol_, address to_, uint256 amount_) public whenNotPaused {
        require(tokens[symbol_] != 0x0, "invalid symbol");
        require(amount_ > 0 ,"amount must greater than 0");


        address contract_ = tokens[symbol_];
        address from_ = msg.sender;

        ERC20Interface = ERC20(contract_);

        uint256 transactionId = transactions.push(
            Transfer({
            contract_ : contract_,
            to_ : to_,
            amount_ : amount_,
            failed_ : true
            })
        );
        transactionIndexesToSender[from_].push(transactionId - 1);

        if (amount_ > ERC20Interface.allowance(from_, address(this))) {
            emit TransferFailed(from_, to_, amount_);
            revert("amount greater then allowance");
        }
        ERC20Interface.transferFrom(from_, to_, amount_);

        transactions[transactionId - 1].failed_ = false;

        emit TransferSuccessful(from_, to_, amount_);
    }

    /**
    * @dev allow contract to receive funds
    */
    function() public payable {}

    /**
    * @dev withdraw funds from this contract
    * @param beneficiary address to receive ether
    */
    function withdraw(address beneficiary) public payable onlyOwner whenNotPaused {
        beneficiary.transfer(address(this).balance);
    }
}

